description:
This was not included on the Season 11 DVD box set of Cheers.  I found my VHS copy of the show that was shown before the Finale for Season 11 and the series.  This is a VHS copy so it is not DVD quality.  It is XVID format and the resolution is 512 X 384.  Enjoy.

